    def detailsTableSet(self):
        row = 0
        self.BillDetailsTable.setRowCount(len(self.billdetails))
        for i in self.billdetails:
            self.BillDetailsTable.setItem(row,0,QtWidgets.QTableWidgetItem(self.billdetails['Item #']))
            self.BillDetailsTable.setItem(row,1,QtWidgets.QTableWidgetItem(self.billdetails['Details']))
            self.BillDetailsTable.setItem(row,2,QtWidgets.QTableWidgetItem(self.billdetails['Price']))
            row = row + 1

    def AddRolls(self):
        self.typ = ''
        if(self.OtherTypeReels.toPlainText()!='' or self.RollsPaperTypeComboBox.currentText=='select item from drop down'):
            self.typ = self.OtherTypeReels.toPlainText()
        #if(self.OtherTypeReels.toPlainText())
        elif(self.RollsPaperTypeComboBox.currentText()=='Fluting'):
            self.typ = 'F'
        elif(self.RollsPaperTypeComboBox.currentText()=='L1'):
            self.typ = 'L1'
        elif(self.RollsPaperTypeComboBox.currentText()=='L2'):
            self.typ = 'L2'
        elif(self.RollsPaperTypeComboBox.currentText()=='TL'):
            self.typ = 'TL'
        elif(self.RollsPaperTypeComboBox.currentText()=='Kraft'):
            self.typ = 'KR'
        elif(self.RollsPaperTypeComboBox.currentText()=='BB 2.5 No'):
            self.typ = 'BB2.5No'
        elif(self.RollsPaperTypeComboBox.currentText()=='L2 Bareek'):
            self.typ = 'L2 Br'
        elif(self.RollsPaperTypeComboBox.currentText()=='L1 Bareek'):
            self.typ = 'L1 Br'
        elif(self.RollsPaperTypeComboBox.currentText()=='Fluting Bareek'):
            self.typ = 'F Br'
        elif(self.RollsPaperTypeComboBox.currentText()=='BB 2.5 No Bareek'):
            self.typ = 'BB2.5No Br'
        self.details1= self.RollsSizeComboBox.currentText()+self.typ+' '+self.RollsQuantity.toPlainText()+' Rolls'
        self.price = float(self.RollsSizeComboBox.currentText())*float(self.RollsQuantity.toPlainText())*float(self.RollsRate.toPlainText())
        self.itemnumber = self.itemnumber + 1
        self.billdetails.loc[-1] = [self.itemnumber,self.details1,self.price]
        self.billdetails.index = self.billdetails.index + 1  # shifting index
        self.billdetails = self.billdetails.sort_index()  # sorting by index
        print(self.billdetails['Price'])
        self.detailsTableSet()
        #self.details= self.details+self.RollsSizeComboBox.currentText()+self.typ+' '+self.RollsQuantity.toPlainText()+' || '
